  false,\n\t\"url\": null,\n\t\"notes\": \"The Rocky Mountain Arsenal National Wildlife
  Refuge was previously used for the production of military munitionsu00b7and chemical
  pesticides. Significant areas of the Refuge were contaminated by waste storage and
  disposal practices, and it is listed as a Superfund site under the Comprehensive
  Environmental Response, Compensation, and Liability Act (CERCLA). Despite the contamination,
  the Refuge supports abundant and diverse wildlife communities. As part of the U.S.
  Fish and Wildlife Service's biomonitoring program, we are investigating and evaluating
  the black-billed magpie (Pica pica) as a biomonitor of environmental contamination.
  We conducted field studies from February-August in 1995 and January-August in 1996.
  This report summarizes our preliminary findings and outlines our goals for 1997.
  Our objectives were: (1). to determine the effects of contaminants on magpie reproduction
  by comparing reproductive parameters between nests in contaminated (core) areas,
  and uncontaminated (non-core) areas, (2). to estimate survival of fledgling, and
  adult black-billed magpies using banding and radio telemetry techniques, and (3).
  to measure contaminant burdens in magpie tissues using lethal and non-lethal collection
  methods and geographically correlate these findings to known contaminant distributions.\",\n\t\"owner_org\":
